import SHOP_DATA from './shop.data';
import ShopActionsType from './shop.actions';

const INITIAL_STATE = {
	collections: SHOP_DATA
}

const shopRedcuer = (state = INITIAL_STATE, action) => {
	switch (action.type) {
		case ShopActionsTypes.
    default:
      return state;
  }
}

export default shopRedcuer;
